            static void Sort(int[] bubble)
            {
                int round = 0;
                Stopwatch stopwatch = new Stopwatch();
                stopwatch.Start();
                bool swapped = true;
                int n = bubble.Length;
                while (swapped != false)
                {
                  // Console.WriteLine($"new round{round++}: ");

                    swapped = false;
                    for (int i = 0; i < n-1; i++)
                    {
                        if (bubble[i] > bubble[i+1])
                        {

                        //  Console.Write($"{bubble[i] }, { bubble[i+1]}: ");
                            (bubble[i], bubble[i + 1]) = (bubble[i + 1], bubble[i]);
                          //Console.WriteLine($"after swap {bubble[i]}, {bubble[i + 1]}");
                            swapped = true;
                        }
                    }
                   // n--;
                }
                stopwatch.Stop();
                Console.WriteLine("fished sorting");
                Console.WriteLine($"Tid til at sortere: {stopwatch.Elapsed.TotalMilliseconds} ms");
                stopwatch.Reset();




            }
           
